import "./Navbar.css"
import React, { useState } from 'react';

import Home from '../Home/Home';
import About from '../IceCream/IceCream';
import IceCream from '../IceCream/IceCream';

//back out .., into home and then home 


function Navbar() {

    const [currentPage, setCurrentPage] = useState('home'); // State to track the current page

    // Render the appropriate page component based on the current page state
    const renderPage = () => {
      switch (currentPage) {
        case 'home':
          return <Home />;
        case 'about':
          return <About />;
        case 'icecream':
          return <IceCream />;
        default:
          return <Home />;
      }
    };

    return (
        <div>
            {/* Your existing navbar */}
            <nav class="taskbar">
                <ul>
                  <li onClick={() => setCurrentPage('home')}>Home</li>
                  <li onClick={() => setCurrentPage('about')}>About</li>
                  <li onClick={() => setCurrentPage('icecream')}>IceCream </li>
                </ul>
            </nav>



            {/* Render the selected page */}
            {renderPage()}
        </div>
    );





}

export default Navbar;
